import React from 'react';
import DashboardLayout from '../components/Layout/DashboardLayout';
import { useAuth } from '../context/AuthContext';
import { BookOpen, Users, Calendar, Clock, FileText, Award } from 'lucide-react';

const TeacherDashboard = () => {
    const { user } = useAuth();

    const statsCards = [
        { title: 'My Courses', value: '5', icon: BookOpen, color: 'from-green-500 to-green-600', bgColor: 'bg-green-50' },
        { title: 'Total Students', value: '127', icon: Users, color: 'from-blue-500 to-blue-600', bgColor: 'bg-blue-50' },
        { title: 'Classes Today', value: '3', icon: Calendar, color: 'from-purple-500 to-purple-600', bgColor: 'bg-purple-50' },
        { title: 'Hours Taught', value: '42', icon: Clock, color: 'from-orange-500 to-orange-600', bgColor: 'bg-orange-50' }
    ];

    const upcomingClasses = [
        { subject: 'Mathematics 101', time: '09:00 AM', students: 32 },
        { subject: 'Advanced Calculus', time: '11:30 AM', students: 24 },
        { subject: 'Statistics', time: '02:00 PM', students: 28 }
    ];

    const recentActivities = [
        { action: 'Graded assignment', subject: 'Math Quiz #5', time: '2 hours ago' },
        { action: 'Posted new material', subject: 'Chapter 7 Notes', time: '5 hours ago' },
        { action: 'Responded to doubt', subject: 'Student question', time: 'Yesterday' }
    ];

    return (
        <DashboardLayout>
            <div className="space-y-6">
                {/* Welcome Section */}
                <div className="bg-gradient-to-r from-green-600 to-green-700 rounded-2xl p-6 text-white">
                    <h1 className="text-2xl font-bold">Welcome back, {user?.name}!</h1>
                    <p className="mt-2 text-green-100">You have 3 classes scheduled for today. Keep inspiring your students!</p>
                </div>

                {/* Stats Grid */}
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                    {statsCards.map((card, index) => (
                        <div
                            key={index}
                            className="bg-white rounded-xl shadow-sm border border-gray-100 p-6 hover:shadow-md transition-shadow"
                        >
                            <div className="flex items-center justify-between">
                                <div>
                                    <p className="text-sm text-gray-500 font-medium">{card.title}</p>
                                    <p className="text-3xl font-bold text-gray-900 mt-2">{card.value}</p>
                                </div>
                                <div className={`p-3 rounded-xl ${card.bgColor}`}>
                                    <card.icon className="w-6 h-6" style={{ color: card.color.includes('green') ? '#22c55e' : card.color.includes('blue') ? '#3b82f6' : card.color.includes('purple') ? '#a855f7' : '#f97316' }} />
                                </div>
                            </div>
                        </div>
                    ))}
                </div>

                {/* Content Grid */}
                <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
                    {/* Upcoming Classes */}
                    <div className="bg-white rounded-xl shadow-sm border border-gray-100 p-6">
                        <div className="flex items-center justify-between mb-4">
                            <h2 className="text-lg font-semibold text-gray-900">Today's Classes</h2>
                            <Calendar className="w-5 h-5 text-gray-400" />
                        </div>
                        <div className="space-y-4">
                            {upcomingClasses.map((cls, index) => (
                                <div
                                    key={index}
                                    className="flex items-center justify-between p-4 bg-gray-50 rounded-lg hover:bg-gray-100 transition-colors"
                                >
                                    <div className="flex items-center gap-3">
                                        <div className="w-2 h-2 bg-green-500 rounded-full"></div>
                                        <div>
                                            <p className="font-medium text-gray-900">{cls.subject}</p>
                                            <p className="text-sm text-gray-500">{cls.students} students enrolled</p>
                                        </div>
                                    </div>
                                    <span className="text-sm font-medium text-green-600 bg-green-100 px-3 py-1 rounded-full">
                                        {cls.time}
                                    </span>
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Recent Activity */}
                    <div className="bg-white rounded-xl shadow-sm border border-gray-100 p-6">
                        <div className="flex items-center justify-between mb-4">
                            <h2 className="text-lg font-semibold text-gray-900">Recent Activity</h2>
                            <FileText className="w-5 h-5 text-gray-400" />
                        </div>
                        <div className="space-y-4">
                            {recentActivities.map((activity, index) => (
                                <div key={index} className="flex items-start gap-3 p-3">
                                    <div className="p-2 bg-green-100 rounded-lg flex-shrink-0">
                                        <Award className="w-4 h-4 text-green-600" />
                                    </div>
                                    <div>
                                        <p className="text-sm font-medium text-gray-900">{activity.action}</p>
                                        <p className="text-sm text-gray-500">{activity.subject}</p>
                                        <p className="text-xs text-gray-400 mt-1">{activity.time}</p>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>
                </div>

                {/* Quick Info */}
                <div className="bg-white rounded-xl shadow-sm border border-gray-100 p-6">
                    <h2 className="text-lg font-semibold text-gray-900 mb-4">Teacher Portal</h2>
                    <p className="text-gray-600">
                        Welcome to your teacher dashboard. This is a demonstration view showing your teaching overview.
                        In the full version, you would be able to manage courses, grade assignments, and communicate with students.
                    </p>
                    <div className="mt-4 p-4 bg-green-50 rounded-lg border border-green-200">
                        <p className="text-sm text-green-700">
                            <strong>Note:</strong> Additional features like course management and grading will be available in Phase 2.
                        </p>
                    </div>
                </div>
            </div>
        </DashboardLayout>
    );
};

export default TeacherDashboard;
